from standardized_dna_diffusion_pipeline.sequence_set import SequenceSet
from standardized_dna_diffusion_pipeline.analyzer import Analyzer, FrequentMotifs
from pyjaspar import jaspardb
from functools import partial
from typing import List

data_path = 'C:/Users/kunal/Documents/BoekeLabResearch/PromoterResearchProject/sequences_set_states/128_1x2x2x2x2x4x4x8x8x16_post_generation_sequence_set_3_and_2.json'
sequences = SequenceSet.from_file(data_path)
print("loaded data")

analyzer = Analyzer(sequences)

coding_hk_query = analyzer.query_by_class_and_generated("CODING_HK_DNA", False)

sequences = [
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
    "",
]

sequence_queries = [coding_hk_query]
for sequence in sequences:
    sequence_queries.append(analyzer.query_by_(sequence))


motif_set = FrequentMotifs()
motifs = {
    "TATA": FrequentMotifs.tata_motif,
    "Initiator": FrequentMotifs.initiator_motif,
    "CCAAT": FrequentMotifs.ccaat_motif,
    "GC BOX": FrequentMotifs.gc_motif,
}

for query in sequence_queries:

    jaspar_db = jaspardb(release="JASPAR2024")
    gabpa_factor = jaspar_db.fetch_motif_by_id("MA0062.2")
    analyzer.perform_analysis(
        analysis_func=partial(
            analyzer.analysis_tfs,
            motifs = [gabpa_factor],
            threshold = 0.8,
            input_name = "GABPA"
        ),
        sequences=query,
    )
    for name, motif in motifs.items():
        analyzer.perform_analysis(
            analysis_func=partial(
                analyzer.analysis_tfs,
                motifs = [motif],
                threshold = 0.8,
                input_name = name
            ),
            sequences=query,
        )

tags = ["TATA", "Initiator", "CCAAT", "GC BOX", "GABPA"]

for tag in tags:
    for i, query in enumerate(sequence_queries):
        if i == 0: continue
        analyzer.plot_analysis(
            [coding_hk_query, query]
            [tag],
            ["coding hk sequences", f"sequence {i}"],
            normalize=False,
            reduce_noise=True,
        )